import React, {useEffect, useState} from 'react';
import "./App.css";

import Preloader from './home/preloader';
import $ from "jquery";

import login from './img/login.png';

const App = ({ children }) => {

  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data);
      }
    )  
  }, [])


   $( function () {
    $("#logo-container").css("opacity", "1");
    setTimeout(() => {
      $(".fadein").css("opacity", "1");
      $("#left-background").css("transition",  "left .65s cubic-bezier(.49, .99, .62, .97)");
      $("#left-background").css("left",  "-50vw");
      $("#logo-other").css("left",  "0");
      setTimeout(() => {
        $("#left-background").css("transition",  "left 0s");
      }, 650)
    }, 2750);

  })

  //       <div> Hello, {(typeof backendData.user === 'undefined') ? (<p>loading...</p>) : (<p>{backendData.user}</p>)}!</div>

  // todo change navbar <p> to <a> 

  return (
      <div className="App">
          <Preloader />

          <div id="logo-container">
            <div id="logo-p">
              P
            </div>
            <div id="logo-other-container">
              <div id="logo-other">
                ENTAGON.
              </div>
            </div>
          </div>

          <div id="navbar">
            <p className="navbar-item">Download de app</p>
            <p className="navbar-item">Ontmoet het team</p>
            <p className="navbar-item">Over ons</p>
          </div>

          <div id="login" className="fadein">
            <img src={login} />
            <p id="login-text">
              LOGIN OF<br></br>REGISTREER HIER
            </p>
          </div>

          <div id="get-better-grades" className="fadein">
            Haal<br></br>Betere<br></br>Resultaten
          </div>

          <div id="left-background"></div>

      </div>
  );
}

export default App;
